import { useEffect } from "react";
import { useState } from "react";
import { baseUrl } from "../config";


// https://pastebin.com/raw/xdLmcpTU
const CareerCreate = () => {
  const [companyName, setJobOpening] = useState();
  const [companyPosition, setPosition] = useState();
  const [companLocation, setLocation] = useState();
  const [companyDescription, setDescription] = useState();

  const handleSumbit = async () =>{
    try{
      const response = await fetch(`${baseUrl}/job`,{
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          "company": companyName,
          "position": companyPosition,
          "location": companLocation,
          "description": companyDescription,
        })
      })
    } catch (erorr){
      console.log("Got error ", erorr)
    }
  }
  const JobCreateCard = () =>{
    return(
      <div className="py-2 mx-auto flex flex-col max-w-lg">
        <form className="border-2 border-gray-300 shadow-xl outline-1 flex flex-col justify-start gap-2 px-2 py-2 rounded-lg">
          <p className="flex border-b-2 border-black">Job Creator</p>
          <label className="text-md" htmlFor="companyName">Company Name</label>
          <input onChange="" className="bg-gray-300 border border-gray-300 rounded-md focus:bg-white"/>
          <label className="text-md" htmlFor="companyName">Job Postion</label>
          <input onChange="" className="bg-gray-300 border border-gray-300 rounded-md focus:bg-white"/>
          <label className="text-md" htmlFor="companyName">Company Name</label>
          <input onChange="" className="bg-gray-300 border border-gray-300 rounded-md focus:bg-white"/>
          <label className="text-md" htmlFor="companyName">Company Name</label>
          <input onChange="" className="bg-gray-300 border border-gray-300 rounded-md focus:bg-white"/>
          <label className="text-md" htmlFor="companyName">Job Location</label>
          <input onChange="" className="bg-gray-300 border border-gray-300 rounded-md focus:bg-white"/>
          <label className="text-md" htmlFor="companyName">Job Description</label>
          <input onChange="" className="bg-gray-300 border border-gray-300 rounded-md focus:bg-white" type="text"/>

        </form>
      </div>
  
    )
  }
  return (
    <>
      <JobCreateCard></JobCreateCard>
      {/* <input onChange={e => setJobOpening(e.target.value)}/>Enter Company
      <input onChange={e => setPosition(e.target.value)}/>Enter Company
      <input onChange={e => setLocation(e.target.value)}/>Enter Company
      <input onChange={e => setDescription(e.target.value)}/>Enter Company

      <button onClick={handleSumbit}  type="button">Click me</button> */}
    </>
  );
};

export default CareerCreate;
